VALUES ('3175681216273', 'Galettes Boulghour de blé Parmesan et Tomates confites', 'Boulghour de blé précuit* 54,8%, farine de blé* 9,9%, eau, fromage parmesan* 6,7%, huile de tournesol oléique* , flocons d\'avoine complète* 4,1 %, flocons de blé complet* 4%, tomates confites* 2,3% (tomates huile d\'olive*), basilic* , concentré de tomates* 1,3%, sel de mer, tomates séchées* 0,3%, ail* , poivre* *Ingrédients issus de l\'agriculture biologique. Fabriqué dans un atelier qui utilise du céleri, du sésame et des fruits à coque. Avant ouverture, peut être conservé à température ambiante.', 'https://static.openfoodfacts.org/images/products/317/568/121/6273/front_fr.11.400.jpg', '10', '2', '28', '2.4', '7', '7.9', '1.1', '0.433070866141732', '', '0');

